import React from 'react'
 
export const Navbar = () => {
    function handlehome(){
        window.location.reload()
    }
    return (
            <nav className="navbar fixed-top navbar-expand-md navbar-dark bg-dark mb-3">
                
                <center><h3 className='topbar' >ADMIN DASHBOARD</h3></center>
            </nav>
    )
}
export default Navbar
